Why can't I authenitcate a registered user for this simple MEAN app?<p>First of all, let me give you a <strong>warm</strong> thank you for giving a thought to this question.</p>

<p>So, what's the problem?</p>

<p>(This is a simple problem for most of you grandmasters!)</p>

<p>Well, the user can be registered to this simple app. But, for some reason, <strong>authentication doesn't work</strong>. That <em>some reason</em> is what my brain nerves having a hard time comprehending! 
Having tried all the possible solutions for hours and hours, this novice-newbie decided to head over to the haven of veterans here in the StackOverflow!</p>

<p>Let me give you the code, so you can shed me some bright light!</p>

<p>Following is a capture of the code written for the authentication</p>

<pre class="lang-js prettyprint-override"><code>//Authenticating the user

router.post('/authenticate', (req, res, next) =&gt; {

    const username = req.body.username;
    const password = req.body.password;



    User.getUserByUsername(username, (err, user) =&gt; {
        if (err) throw err;

        if (!user) {

            return res.json({
                sucess: false,
                msg: 'There is no such user found here'
            });
        }

        User.comparePassword(password, user.password, (err, isMatch) =&gt; {

            if (err) throw err;
            if (isMatch) {
                const token = jwt.sign(user.toJSON(), config.secret, {
                    expiresIn: 604800 // 1 week
                });
                res.json({

                    success: true,
                    token: 'JWT' + token,
                    user: {

                        id: user._id,
                        name: user.name,
                        username: user.username,
                        email: user.email
                    }

                });
            } else {

                return res.json({
                    success: false,
                    msg: 'Enter the correct details!'
                });

            }

        });



    });



});


//Getting into the dashboard

router.get('/profile', passport.authenticate('jwt', {
        session: false
    }),
    (req, res, next) =&gt; {

        res.json({
            user: req.user
        });

    });
</code></pre>

<p>The next few pictures on your way shows you the POSTMAN requests that are done by this novice. </p>

<p>Here, a post request is done to register the user and as you can see, there's not a smidgen of a problem there; the user is, without a doubt, registered!</p>

<p><a href="https://i.stack.imgur.com/FrItJ.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/FrItJ.png" alt="**postman pic**"></a></p>

<p>Here's the authentication done with POSTMAN</p>

<p><a href="https://i.stack.imgur.com/0pmYE.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/0pmYE.png" alt="postman pic2"></a></p>

<p>But now, for some reason (which I have zero clue of), the user is NOT authenticated. This is the problem that I need to solve.</p>

<p>Here is a code of the model/user.js file in case you want to know what's in there as well</p>

<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');
const bcrypt = require('bcryptjs');
const config = require('../config/database');

// These are the collection or entities in ERD language
const UserSchema = mongoose.Schema({

    name: {
        type: String
    },
    email: {
        type: String,
        required: true
    },
    password: {
        type: String,
        required: true
    }
});

const User = module.exports = mongoose.model('user', UserSchema); //User is the name give for this particular model's schema

// these are functions implemented to do a certain task
module.exports.getUserById = function (id, callback) {

    User.findById(id, callback);
}

module.exports.getUserByUsername = function (username, callback) {
    const query = {
        username: username
    }

    User.findOne(query, callback);

}

module.exports.addUser = function (newUser, callback) {

    bcrypt.genSalt(10, (err, salt) =&gt; {
        bcrypt.hash(newUser.password, salt, (err, hash) =&gt; {
            if (err) throw err;
            newUser.password = hash;
            newUser.save(callback);

        });
    })

}


//comparing the hash password

module.exports.comparePassword = function (candidatePasword, hash, callback) {

    bcrypt.compare(candidatePasword, hash, (err, isMatch) =&gt; {
        if (err) throw err;
        callback(null, isMatch);
    });
}
</code></pre>

<p>Thank You for your time!</p>

<p>Stay safe btw!</p>

<p>edit1: The code for the registration or signing up.</p>

<pre class="lang-js prettyprint-override"><code>router.post('/signup', (req, res, next) =&gt; {

    let newUser = new User({
        name: req.body.name,
        email: req.body.email,
        username: req.body.username,
        password: req.body.password

    });

    User.addUser(newUser, (err, user) =&gt; {

        //console.log("registration is working");

        if (err) {
            res.json({
                sucess: false,
                msg: 'Hey! Enter the correct information man!'

            });
        } else {
            res.json({
                success: true,
                msg: 'you are registered'

            });
        }
    });

});
</code></pre>

<p>Here's the whole routes/users.js file for you to refer</p>

<pre class="lang-js prettyprint-override"><code>const express = require('express');
const router = express.Router();
const passport = require('passport');
const jwt = require('jsonwebtoken');
const User = require('../models/user');
const config = require('../config/database');





// Signingup the user

router.post('/signup', (req, res, next) =&gt; {

    let newUser = new User({
        name: req.body.name,
        email: req.body.email,
        username: req.body.username,
        password: req.body.password

    });

    User.addUser(newUser, (err, user) =&gt; {

        //console.log("registration is working");

        if (err) {
            res.json({
                sucess: false,
                msg: 'Hey! Enter the correct information man!'

            });
        } else {
            res.json({
                success: true,
                msg: 'you are registered'

            });
        }
    });

});


//Authenticating the user

router.post('/authenticate', (req, res, next) =&gt; {

    const username = req.body.username;
    const password = req.body.password;



    User.getUserByUsername(username, (err, user) =&gt; {
        if (err) throw err;

        if (!user) {

            return res.json({
                sucess: false,
                msg: 'There is no such user found here'
            });
        }

        User.comparePassword(password, user.password, (err, isMatch) =&gt; {

            if (err) throw err;
            if (isMatch) {
                const token = jwt.sign(user.toJSON(), config.secret, {
                    expiresIn: 604800 // 1 week
                });
                res.json({

                    success: true,
                    token: 'JWT' + token,
                    user: {

                        id: user._id,
                        name: user.name,
                        username: user.username,
                        email: user.email
                    }

                });
            } else {

                return res.json({
                    success: false,
                    msg: 'Enter the correct details!'
                });

            }

        });



    });



});


//Getting into the dashboard

router.get('/profile', passport.authenticate('jwt', {
        session: false
    }),
    (req, res, next) =&gt; {

        res.json({
            user: req.user
        });

    });



router.post('/login', (req, res, next) =&gt; {

    let newUser = new User({
        username: req.body.username,
        password: req.body.password
    });

    User.addUser(newUser, (err, user) =&gt; {

        if (err) {
            res.json({
                success: false,
                msg: "Enter the correct information"
            });
        } else {
            res.json({
                success: true,
                msg: "User loggedIn"
            });
        }

    });
});

module.exports = router;
</code></pre>

