<pre><code>{ user_id : A,
  date.   : '2020-04-01'
 hourly_info : 
   { metric_one :
        { 0 : 4, 
          1: 7,
          2:8
          ..
          23: 43 }}}
</code></pre>

<p>My problem is : for a given user_id and daterange, group by user_id, and calculate sum of metric_one for each hour. sample output would look like below</p>

<p>{ "_id" : "A", "0" : 45, "1" : 28, "2" : 31, .... "23": 67}. </p>

<p>My query : </p>

<pre><code>db.collection.aggregate([
      { '$match': {
           'user_id':"A",   
           'date':{'$lte':ISODate('2020-04-01'),     
           '$gte':ISODate('2020-04-08')   } 
      } }, 
      {'$group':{
            _id: '$user_id', 
           '0': { '$sum': '$hourly_info.metric_one.0'}, 
           '1': { '$sum': '$hourly_info.metric_one.1'}, 
           ... ,
           '23':{ '$sum': '$hourly_info.metric_one.23'}
      }}
]).pretty()
</code></pre>

<p>I would really appreciate if someone could say if there any better way of querying other than summing for each and every hour from 0 to 23. </p>

<p>Is there better way that i can make use for loop so that i don't to have write same summing logic for 0 to 23?</p>

<p>something like below </p>

<pre><code>for (i = 0; i &lt;= 23; i=i+1){ 
db.collection.aggregate([{
    '$match': {
      'user_id':"A",
      'sales_date':{
        '$lte':ISODate('2020-04-01'),
        '$gte':ISODate('2020-04-08')
      }
    }
}, {
        '$group': {
            '_id': '$user_id',
            {i}: {
                '$sum': '$hourly_info.metric_one.{i}'
            }
        }
     }
])
</code></pre>

<p>}</p>

<p>Thanks for your help in advance :) </p>

