      "field": "X"
    },
    {
      "_id": "ID1",
      "field": "Y"
    }
  ]
}
</code></pre>

<p>I want to project <code>B</code> matched with the <code>_id</code> in <code>A</code>. The end result would be:</p>

<pre><code>{
  "B": [
    {
      "_id": "ID0",
      "field": "X"
    }
  ]
}
</code></pre>

<p>I tried the following but apparently I'm doing something wrong. Is it possible to match based on a document filed rather than an explicit condition?</p>

<pre><code>db.collection.aggregate([
  {$match: {"B._id": "$A._id"}},
  {$project: {"B": 1}}
])
</code></pre>

