Embed Field: PyMongo query - check if value exists or not<p>I'm looking to perform a query on a database and extract some data to be processed. Here is my query so far:</p>

<pre><code>pipeline = [{'$match':{"Timestamp":{'$gte':m(), '$lt':current()},

    'Frequency Survey Reference':{'$regex':'Ch2'}}},

    {'$group': {
        '_id': '$Timestamp',
        'Trace' : {'$push': '$TR Trace'}
    }},

    {'$sort': {'_id': -1}},

    {'$limit': 1}
    ]

get_tr = collection.aggregate(pipeline, allowDiskUse=True)
</code></pre>

<p>However, some of the records don't have any value for TR Trace (an empty array), and I want to perform a check where it ignores those entries and doesn't include them in the pipeline. How would I perform such a check?</p>; Answer: First thought coming to my mind was: Why not use a different numbering scheme for the grid? Double resolution. Hexes on first column start with 0 in steps of 2, Hexes of the second column start with 1 in steps of 2. Hence, your hexes are located on a regular square grid with double resolution. Then, you can maybe use bresenham circle algorithm to quickly decide if a hex is intersected with a circle of radius 2 * ring.
